import React, { useState } from 'react';

function Resources() {
  const [resources, setResources] = useState([
    { id: 1, name: "Projector", availability: "Available", location: "Room 101", notes: "For presentations" },
    { id: 2, name: "Sound System", availability: "In Use", location: "Auditorium", notes: "Booked for an event" },
    { id: 3, name: "Conference Room", availability: "Available", location: "Building A - Floor 2", notes: "Seats 20 people" },
  ]);
  
  const [resourceName, setResourceName] = useState('');
  const [availability, setAvailability] = useState('Available');
  const [location, setLocation] = useState('');
  const [notes, setNotes] = useState('');

  // Handle adding a resource
  const handleAddResource = (e) => {
    e.preventDefault();
    if (resourceName && location) {
      const newResource = {
        id: Date.now(),
        name: resourceName,
        availability,
        location,
        notes,
      };
      setResources([...resources, newResource]);
      setResourceName('');
      setAvailability('Available');
      setLocation('');
      setNotes('');
    } else {
      alert("Please enter a resource name and location.");
    }
  };

  // Handle deleting a resource
  const handleDeleteResource = (id) => {
    const updatedResources = resources.filter((resource) => resource.id !== id);
    setResources(updatedResources);
  };

  return (
    <section className="min-h-screen bg-gradient-to-br from-blue-500 to-purple-700 py-20 px-10">
      <div className="max-w-6xl mx-auto bg-white p-10 rounded-lg shadow-xl">
        <h2 className="text-4xl font-bold text-blue-600 text-center mb-10">Resource Management</h2>

        {/* Add Resource Form */}
        <form onSubmit={handleAddResource} className="mb-8 bg-gray-100 p-6 rounded-lg shadow-md">
          <h3 className="text-2xl font-semibold text-gray-700 mb-4">Add New Resource</h3>
          <input 
            type="text" 
            placeholder="Resource Name" 
            className="w-full px-4 py-2 mb-4 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            value={resourceName}
            onChange={(e) => setResourceName(e.target.value)}
          />
          <input 
            type="text" 
            placeholder="Location (e.g., Room 101)" 
            className="w-full px-4 py-2 mb-4 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
          />
          <textarea
            placeholder="Additional Notes (optional)" 
            className="w-full px-4 py-2 mb-4 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            rows="2"
            value={notes}
            onChange={(e) => setNotes(e.target.value)}
          />
          <select 
            className="w-full px-4 py-2 mb-4 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            value={availability}
            onChange={(e) => setAvailability(e.target.value)}
          >
            <option value="Available">Available</option>
            <option value="In Use">In Use</option>
          </select>
          <button 
            type="submit"
            className="w-full bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600 transition duration-300"
          >
            Add Resource
          </button>
        </form>

        {/* Resource List */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {resources.map((resource) => (
            <div key={resource.id} className="bg-gray-100 p-6 rounded-lg shadow-lg relative">
              <h3 className="text-2xl font-semibold text-blue-600 mb-2">{resource.name}</h3>
              <p className={`text-lg font-semibold ${resource.availability === "Available" ? "text-green-500" : "text-red-500"}`}>
                {resource.availability}
              </p>
              <p className="text-gray-600"><b>Location:</b> {resource.location}</p>
              <p className="text-gray-500 text-sm"><b>Notes:</b> {resource.notes || "N/A"}</p>
              <button 
                onClick={() => handleDeleteResource(resource.id)}
                className="absolute top-2 right-2 bg-red-500 text-white px-3 py-1 rounded-md hover:bg-red-600 transition duration-300 text-sm"
              >
                Delete
              </button>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default Resources;
